INSERT INTO `ebi_search` VALUES
(1,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_All_Interaction','E',1,'SELECT A.id AS AppointmentId, N.id AS NoteId, R.id AS ReferralId, C.id AS ContactId, AL.id AS activity_log_id, AL.created_at AS activity_date, AL.activity_type AS activity_type, AL.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, C.contact_types_id AS activity_contact_type_id, CTL.description AS activity_contact_type_text, R.status AS activity_referral_status, C.note AS contactDescription, R.note AS referralDescription, A.description AS appointmentDescription, N.note AS noteDescription, AL.created_at as created_date, A.start_date_time as app_created_date, C.contact_date as contact_created_date, AL.activity_date as act_date FROM activity_log AS AL LEFT JOIN Appointments AS A ON AL.appointments_id = A.id LEFT JOIN note AS N ON AL.note_id = N.id LEFT JOIN note_teams AS NT ON N.id = NT.note_id LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN referrals AS R ON AL.referrals_id = R.id LEFT JOIN referrals_teams AS RT ON R.id = RT.referrals_id LEFT JOIN activity_category AS AC ON A.activity_category_id = AC.id OR N.activity_category_id = AC.id OR R.activity_category_id = AC.id OR C.activity_category_id = AC.id LEFT JOIN person AS P ON AL.person_id_faculty = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN contact_types AS CONT ON C.contact_types_id = CONT.id LEFT JOIN organization_role as orgr ON orgr.organization_id = AL.organization_id LEFT JOIN referral_routing_rules as rr ON rr.activity_category_id = R.activity_category_id WHERE AL.person_id_student = $$studentId$$ AND AL.organization_id = $$orgId$$ AND AL.activity_type IN ($$acivityArr$$) AND AL.deleted_at IS NULL AND A.deleted_at IS NULL AND N.deleted_at IS NULL AND C.deleted_at IS NULL AND R.deleted_at IS NULL AND CASE WHEN AL.activity_type = \"C\" THEN CONT.parent_contact_types_id = 1 OR CONT.id = 1 ELSE 1 = 1 END AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.appointment_id = ALOG.appointments_id WHERE related.appointment_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.referral_id = ALOG.referrals_id WHERE related.referral_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.note_id = ALOG.note_id WHERE related.note_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.contacts_id = ALOG.contacts_id WHERE related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND CASE WHEN AL.activity_type = \"N\" THEN CASE WHEN N.access_team = 1 THEN NT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM note_teams WHERE note_id = N.id AND deleted_at IS NULL)) AND $$noteTeamAccess$$ = 1 ELSE CASE WHEN N.access_private = 1 THEN N.person_id_faculty = $$faculty$$ ELSE N.access_public = 1 AND $$notePublicAccess$$ = 1 END END ELSE CASE WHEN AL.activity_type = \"C\" THEN CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM contacts_teams WHERE contacts_id = C.id AND deleted_at IS NULL)) AND $$contactTeamAccess$$ = 1 ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$faculty$$ ELSE C.access_public = 1 AND $$contactPublicAccess$$ = 1 END END ELSE CASE WHEN AL.activity_type = \"R\" THEN CASE WHEN R.access_team = 1 THEN RT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM referrals_teams WHERE referrals_id = R.id AND deleted_at IS NULL)) AND (($$referralTeamAccess$$ = 1 and R.is_reason_routed = 0) OR ($$referralTeamAccessReasonRouted$$ = 1 and R.is_reason_routed = 1)) ELSE CASE WHEN R.access_private = 1 THEN R.person_id_faculty = $$faculty$$ ELSE R.access_public = 1 AND (($$referralPublicAccess$$ = 1 and R.is_reason_routed = 0) OR ($$referralPublicAccessReasonRouted$$ = 1 and R.is_reason_routed = 1)) END END OR R.person_id_assigned_to = $$faculty$$ OR R.person_id_faculty = $$faculty$$ OR orgr.person_id = $$faculty$$ and R.person_id_assigned_to is null AND orgr.role_id IN ($$roleIds$$) AND (rr.is_primary_coordinator = 1 AND rr.person_id IS NULL) ELSE CASE WHEN AL.activity_type = \"A\" THEN 1 = 1 ELSE 1 = 1 END END END END GROUP BY AL.id ORDER BY act_date DESC'),
(21,NULL,NULL,NULL,NULL,NULL,NULL,'My_Team_Interactions_count_Groupby_Teams','E',1,'\n    select \n    tm.teams_id,\n    t.team_name,\n    count(al.id) as numbers,\n    \"interaction\" as activity\nfrom\n    Teams t,\n    team_members tm,\n    activity_log al\nwhere\n    tm.teams_id = t.id\n        and tm.organization_id = t.organization_id\n        and al.organization_id = tm.organization_id\n        and al.person_id_faculty = tm.person_id\n        and al.activity_type in (\"R\" , \"C\", \"N\", \"A\")\n        and al.activity_date between \"$$fromDate$$\" and \"$$toDate$$\"\n        and al.activity_date between \"$$academicStartDate$$\" and \"$$academicEndDate$$\"\n        and tm.teams_id in (SELECT \n            teams_id\n        FROM\n            team_members\n        where\n            is_team_leader = 1\n                and person_id = \"$$loggedUserId$$\"\n                and deleted_at IS NULL)\n        and tm.organization_id = \"$$organizationId$$\"\n        and t.deleted_at IS NULL\n        and tm.deleted_at IS NULL\n        and al.deleted_at IS NULL\ngroup by t.team_name '),
(22,NULL,NULL,NULL,NULL,NULL,NULL,'My_Team_Open_Referrals_count_Groupby_Teams','E',1,'\n    select\n    tm.teams_id,\n    t.team_name,\n    count(al.id) as numbers,\n    \"openreferrals\" as activity\nfrom\n    Teams t,\n    team_members tm,\n    activity_log al,\n    referrals r\nwhere\n    tm.teams_id = t.id\n        and tm.organization_id = t.organization_id\n        and al.organization_id = tm.organization_id\n        and al.person_id_faculty = tm.person_id\n        and al.activity_type = \"R\"\n        and r.id = al.referrals_id\n        and al.person_id_student in (select person_id from org_group_students where deleted_at is null and organization_id = \"$$organizationId$$\")\n        and r.status = \"O\"\n         and al.activity_date between \"$$fromDate$$\" and \"$$toDate$$\"\n        and al.activity_date between \"$$academicStartDate$$\" and \"$$academicEndDate$$\"\n        and tm.teams_id in (SELECT\n            teams_id\n        FROM\n            team_members\n        where\n            is_team_leader = 1\n                 and person_id = \"$$loggedUserId$$\"\n                and deleted_at IS NULL)\n        and tm.organization_id = \"$$organizationId$$\"\n        and t.deleted_at IS NULL\n        and tm.deleted_at IS NULL\n        and al.deleted_at IS NULL\ngroup by t.team_name '),
(23,NULL,NULL,NULL,NULL,NULL,NULL,'My_Team_Logins_Count_Groupby_Teams','E',1,'select tm.teams_id, t.team_name, count(al.id) as numbers, \'logins\' as activity from Teams t, team_members tm, activity_log al where tm.teams_id = t.id and tm.organization_id = t.organization_id and al.organization_id = tm.organization_id and al.person_id_faculty = tm.person_id and al.activity_type = \'L\' and al.activity_date between \'$$fromDate$$\' and \'$$toDate$$\' and tm.teams_id in (SELECT teams_id FROM team_members where is_team_leader = 1 and person_id = \'$$loggedUserId$$\' and deleted_at IS NULL) and tm.organization_id = \'$$organizationId$$\' and t.deleted_at IS NULL and tm.deleted_at IS NULL and al.deleted_at IS NULL group by t.team_name -- maxscale route to server slave1 '),
(24,NULL,NULL,NULL,NULL,NULL,NULL,'My_Team_List_with_OpenReferrals_and_otherActivities','E',1,'\n(select \"openreferrals\" as activity,al.activity_date as activity_date,al.person_id_faculty as team_member_id,pa.firstname as team_member_firstname,\npa.lastname as team_member_lastname, pa.username as primary_email,al.person_id_student as student_id,(CASE WHEN gs.person_id IS NOT NULL and gs.deleted_at IS NULL \nthen p.firstname ELSE \"\" END) as student_firstname,(CASE WHEN gs.person_id IS NOT NULL and gs.deleted_at IS NULL then p.lastname ELSE \"\" END) as student_lastname,\n\"O\" as activity_type, al.referrals_id, al.appointments_id, al.note_id, al.contacts_id, \"\" as reason_id, al.reason as reason_text,r.status,gs.person_id \nfrom activity_log al left join referrals r on r.id = al.referrals_id join org_group_students gs on (al.person_id_student = gs.person_id and gs.deleted_at is null and gs.org_group_id in \n(select distinct org_group_id from org_group_faculty where person_id in ($$personId$$) and deleted_at IS NULL )) \nleft join person pa on pa.id = al.person_id_faculty left join person p on p.id = al.person_id_student where al.activity_type in (\"R\") \nand al.activity_date between \"$$fromDate$$\" and \"$$toDate$$\" and al.activity_date between \"$$academicStartDate$$\" and \"$$academicEndDate$$\" and al.person_id_faculty in ($$teamMemberId$$) and al.deleted_at IS NULL and al.organization_id = \"$$organizationId$$\" \ngroup by al.id) union (select \"interactions\" as activity,al.activity_date as activity_date,al.person_id_faculty as team_member_id, pa.firstname as team_member_firstname,\npa.lastname as team_member_lastname, pa.username as primary_email,al.person_id_student as student_id,(CASE WHEN gs.person_id IS NOT NULL and gs.deleted_at IS NULL \nthen p.firstname ELSE \"\" END) as student_firstname,(CASE WHEN gs.person_id IS NOT NULL and gs.deleted_at IS NULL then p.lastname ELSE \"\" END) as student_lastname, \nal.activity_type as activity_type, al.referrals_id, al.appointments_id, al.note_id, al.contacts_id, \"\" as reason_id, al.reason as reason_text,\"\" as status,\ngs.person_id from activity_log al left outer join org_group_students gs on (al.person_id_student = gs.person_id and gs.org_group_id in \n(select distinct org_group_id from org_group_faculty where person_id in ($$personId$$) and deleted_at IS NULL )) left join person pa on pa.id = al.person_id_faculty \nleft join person p on p.id = al.person_id_student where al.activity_type in (\"A\",\"C\",\"N\",\"L\") and al.activity_date between \"$$fromDate$$\" and \"$$toDate$$\" \nand al.person_id_faculty in ($$teamMemberId$$) and al.deleted_at IS NULL and al.organization_id = \"$$organizationId$$\" group by al.id) [ORDER_BY] [LIMIT]\n'),
(25,NULL,NULL,NULL,NULL,NULL,NULL,'My_Team_List_without_Referrals','E',1,'\nselect \'interactions\' as activity,al.activity_date as activity_date,al.person_id_faculty as team_member_id,pa.firstname as team_member_firstname,pa.lastname as team_member_lastname, pa.username as primary_email,al.person_id_student as student_id, (CASE WHEN gs.person_id IS NOT NULL and gs.deleted_at IS NULL then p.firstname ELSE \'\' END) as student_firstname,(CASE WHEN gs.person_id IS NOT NULL and gs.deleted_at IS NULL then p.lastname ELSE \'\' END) as student_lastname,al.activity_type as activity_type, al.referrals_id, al.appointments_id, al.note_id, al.contacts_id, \'\' as reason_id, al.reason as reason_text,r.status,gs.person_id from activity_log al left join referrals r on r.id = al.referrals_id left outer join org_group_students gs on (al.person_id_student = gs.person_id and gs.org_group_id in (select distinct org_group_id from org_group_faculty where person_id in ($$personId$$) and deleted_at IS NULL )) left join person pa on pa.id = al.person_id_faculty left join person p on p.id = al.person_id_student where al.activity_type in (\'A\',\'C\',\'N\',\'R\') and al.activity_date between \'$$fromDate$$\' and \'$$toDate$$\' and al.person_id_faculty in ($$teamMemberId$$) and al.deleted_at IS NULL and al.organization_id = \'$$organizationId$$\'  group by al.id [ORDER_BY] [LIMIT] -- maxscale route to server slave1\n'),
(26,NULL,NULL,NULL,NULL,NULL,NULL,'My_Team_List_with_only_Logins','E',1,'\nselect \'logins\' as activity,al.activity_date as activity_date,al.person_id_faculty as team_member_id,pa.firstname as team_member_firstname,pa.lastname as team_member_lastname, ci.primary_email, \'\' as student_id, \'\' as student_firstname,\'\' as student_lastname,al.activity_type as activity_type, al.referrals_id, al.appointments_id, al.note_id, al.contacts_id, \'\' as activity_id, \'\' as reason_id, \'-\' as reason_text,\'\' as status from activity_log al left join person pa on pa.id = al.person_id_faculty left join person_contact_info pci on pci.person_id = al.person_id_faculty left join contact_info ci on ci.id = pci.contact_id where al.activity_type in (\'L\') and al.activity_date between \'$$fromDate$$\' and \'$$toDate$$\' and al.person_id_faculty in ($$teamMemberId$$) and al.deleted_at IS NULL and al.organization_id = \'$$organizationId$$\' [ORDER_BY] [LIMIT] -- maxscale route to server slave1\n'),
(27,NULL,NULL,NULL,NULL,NULL,NULL,'My_Team_List_with_only_OpenReferrals','E',1,'\nselect \"openreferrals\" as activity,al.activity_date as activity_date,al.person_id_faculty as team_member_id,pa.firstname as team_member_firstname,\npa.lastname as team_member_lastname, pa.username as primary_email,\nal.person_id_student as student_id, (CASE WHEN gs.person_id IS NOT NULL and gs.deleted_at IS NULL then p.firstname ELSE \"\" END) \nas student_firstname,(CASE WHEN gs.person_id IS NOT NULL and gs.deleted_at IS NULL then p.lastname ELSE \"\" END) as student_lastname,\"O\" as activity_type, \nal.referrals_id, al.appointments_id, al.note_id, al.contacts_id, \"\" as reason_id, al.reason as reason_text,r.status,gs.person_id from activity_log al \nleft join referrals r on r.id = al.referrals_id join org_group_students gs on (al.person_id_student = gs.person_id and gs.deleted_at is null and \ngs.org_group_id in (select distinct org_group_id from org_group_faculty where person_id in ($$personId$$) and deleted_at IS NULL )) \nleft join person pa on pa.id = al.person_id_faculty left join person p on p.id = al.person_id_student where al.activity_type in (\"R\") \nand r.status = \"O\" and al.activity_date between \"$$fromDate$$\" and \"$$toDate$$\" and al.activity_date between \"$$academicStartDate$$\" and \"$$academicEndDate$$\" and al.person_id_faculty in ($$teamMemberId$$) and al.deleted_at IS NULL \nand al.organization_id = \"$$organizationId$$\" group by al.id [ORDER_BY] [LIMIT]\n'),
(34,NULL,NULL,NULL,NULL,NULL,NULL,'My_High_priority_students_Count','E',1,'select count(distinct p.id) as highCount\n        from person p\n        LEFT JOIN org_person_student os on (os.person_id = p.id and os.organization_id = p.organization_id )     \n        join\n        (\n           select\n           ogs.person_id\n           from org_group_students ogs\n           join org_group_faculty ogf on ogs.org_group_id = ogf.org_group_id\n           and ogf.person_id = $$personId$$\n           and ogf.deleted_at is null\n           join org_permissionset op on op.id = ogf.org_permissionset_id\n           and op.deleted_at is null\n           and op.risk_indicator = 1\n           and op.accesslevel_ind_agg = 1\n           where ogs.deleted_at is null\n           union\n           all\n           select\n           ocs.person_id\n           from org_course_student ocs\n           join org_course_faculty ocf on ocs.org_courses_id = ocf.org_courses_id\n           and ocf.person_id = $$personId$$\n           and ocf.deleted_at is null\n           join org_permissionset op on op.id = ocf.org_permissionset_id\n           and op.deleted_at is null\n           and op.risk_indicator = 1\n           and op.accesslevel_ind_agg = 1\n           join org_courses oc on oc.id = ocf.org_courses_id\n           and oc.deleted_at is null\n           join org_academic_terms oat on oat.id = oc.org_academic_terms_id\n           and oat.deleted_at is null\n           and oat.end_date >= date(now())\n           where ocs.deleted_at is null\n        )\n        people_faculty_can_see_risk_for on p.id = people_faculty_can_see_risk_for.person_id\n        where (p.last_contact_date <= p.risk_update_date or p.last_contact_date is null)\n        and p.deleted_at is null\n        and p.risk_level in ($$risklevel$$) AND (os.status is null or os.status = 1) AND os.organization_id =  $$orgId$$ and os.deleted_at is null'),
(35,NULL,NULL,NULL,NULL,NULL,NULL,'My_Total_Students_Count_Groupby_Risk','E',1,'SELECT RL.id AS risk_level, count(DISTINCT P.id) as totalStudentsHighPriority, RL.risk_text, RL.image_name, RL.color_hex FROM risk_level AS RL INNER JOIN person AS P ON P.risk_level=RL.id AND P.deleted_at IS NULL LEFT JOIN org_person_student os on (os.person_id = P.id and os.organization_id = P.organization_id ) INNER JOIN (SELECT S.person_id AS person_id, F.org_permissionset_id AS permissionset_id FROM org_group_students AS S INNER JOIN org_group_faculty AS F ON F.org_group_id = S.org_group_id and F.deleted_at is null WHERE S.deleted_at is null AND F.person_id=$$personId$$ UNION ALL SELECT S.person_id AS student_id, F.org_permissionset_id AS permissionset_id FROM org_course_student AS S INNER JOIN org_courses AS C ON C.id = S.org_courses_id AND C.deleted_at is null INNER JOIN org_course_faculty AS F ON F.org_courses_id = S.org_courses_id AND F.deleted_at is null INNER JOIN org_academic_terms AS OAT ON OAT.id = C.org_academic_terms_id AND OAT.end_date >= now() AND OAT.deleted_at is null WHERE S.deleted_at is null AND F.person_id=$$personId$$) AS merged ON merged.person_id=P.id INNER JOIN org_permissionset OPS ON merged.permissionset_id = OPS.id AND (OPS.accesslevel_ind_agg = 1) AND OPS.risk_indicator = 1 WHERE (os.status is null or os.status = 1) AND os.organization_id = $$orgId$$ and os.deleted_at is null GROUP BY RL.id'),
(36,NULL,NULL,NULL,NULL,NULL,NULL,'My_High_priority_students_List','E',1,'\nselect\nSQL_CALC_FOUND_ROWS p.id,\np.id,\np.firstname,\np.lastname,\np.risk_level,\nitl.image_name as intent_imagename,\nitl.text as intent_text,\nrl.image_name as risk_imagename,\nrl.risk_text,\np.intent_to_leave as intent_leave,\n(count(distinct (lc.id))) as login_cnt,\np.cohert,\n(\n	select\n	(case when (activity_type=\'N\')\n		then concat(DATE_FORMAT(activity_date,\'%m/%d/%y\'), \' - \',\'Note\')\n		when (activity_type=\'A\')\n	then concat(DATE_FORMAT(activity_date,\'%m/%d/%y\'), \' - \',\'Appointment\')\n		when (activity_type=\'C\')\n				then concat(DATE_FORMAT(activity_date,\'%m/%d/%y\'), \' - \',\'Contact\')\n		when (activity_type=\'E\')\n				then concat(DATE_FORMAT(activity_date,\'%m/%d/%y\'), \' - \',\'Email\')\n		when (activity_type=\'R\')\n				then concat(DATE_FORMAT(activity_date,\'%m/%d/%y\'), \' - \',\'Referral\')\n				else\n					concat(DATE_FORMAT(activity_date,\'%m/%d/%y\'), \' - \',\'Login\')\n	END) as new\n    from activity_log where id =  max(lc.id)\n) as last_activity ,\nops.status,\nitl.color_hex as intent_color,\nrl.color_hex as risk_color,\n1 as risk_flag,\nunique_people_this_faculty_member_can_see_risk_for.intent_to_leave as intent_flag,\nelv.list_name as class_level\nfrom person p\nLEFT JOIN org_person_student os on (os.person_id = p.id and os.organization_id = p.organization_id )        \njoin\n(\n   select person_id, max(intent_to_leave) as intent_to_leave\n   from\n   (\n      select\n      ocs.person_id, flags.intent_to_leave\n      from org_course_student ocs\n      join\n      (\n         select\n         ocf.org_courses_id, op.intent_to_leave\n         from org_course_faculty ocf\n         join org_courses oc on oc.id = ocf.org_courses_id and oc.deleted_at is null\n         join org_academic_terms oat on oat.id = oc.org_academic_terms_id and oat.deleted_at is null\n         join org_permissionset op on ocf.org_permissionset_id = op.id and op.deleted_at is null\n         where ocf.person_id = $$personId$$\n         and ocf.deleted_at is null\n         and oat.end_date >= date(now())\n         and op.risk_indicator = 1\n         and op.accesslevel_ind_agg = 1\n      )\n      flags on flags.org_courses_id = ocs.org_courses_id and ocs.deleted_at is null\n      union\n      all\n      select\n      ogs.person_id, flags.intent_to_leave\n      from org_group_students ogs\n      join\n      (\n         select\n         ogf.org_group_id, op.intent_to_leave\n         from org_group_faculty ogf\n         join org_permissionset op on ogf.org_permissionset_id = op.id and op.deleted_at is null\n         where ogf.person_id = $$personId$$\n         and ogf.deleted_at is null\n         and op.risk_indicator = 1\n         and op.accesslevel_ind_agg = 1\n      )\n      flags on flags.org_group_id = ogs.org_group_id and ogs.deleted_at is null\n   )\n   non_unique_people_this_faculty_member_can_see_risk_for\n   group by person_id\n)\nunique_people_this_faculty_member_can_see_risk_for on p.id = unique_people_this_faculty_member_can_see_risk_for.person_id\ninner join org_person_student ops on ops.person_id = p.id and ops.deleted_at is null\nleft join risk_level rl on p.risk_level = rl.id\nleft join activity_log lc ON (lc.person_id_student = p.id and lc.deleted_at is null) and lc.activity_type in (\'R\',\'A\',\'C\',\'N\',\'E\')\nleft join intent_to_leave itl on itl.id = p.intent_to_leave\nleft join person_ebi_metadata pem on (pem.person_id = p.id and pem.ebi_metadata_id= [EBI_METADATA_CLASSLEVEL_ID] )\nleft join ebi_metadata_list_values elv on (elv.list_value = pem.metadata_value and elv.ebi_metadata_id = [EBI_METADATA_CLASSLEVEL_ID] )\nwhere p.risk_level in ($$risklevel$$)\nAND (p.last_contact_date < p.risk_update_date OR p.last_contact_date IS NULL)\nand p.deleted_at is null AND (os.status is null or os.status = 1) AND os.organization_id =  $$orgId$$ and os.deleted_at is null\ngroup by p.id\n[ORDER_BY]\n[LIMIT]\n'),
(37,NULL,NULL,NULL,NULL,NULL,NULL,'My_Total_students_List','E',1,'\nselect\nSQL_CALC_FOUND_ROWS p.id,\np.id,\np.firstname,\np.lastname,\np.risk_level,\nitl.image_name as intent_imagename,\nitl.text as intent_text,\nrl.image_name as risk_imagename,\nrl.risk_text,\np.intent_to_leave as intent_leave,\nlc.cnt as login_cnt,\np.cohert,\np.last_activity,\nops.status,\nitl.color_hex as intent_color,\nrl.color_hex as risk_color,\n1 as risk_flag,\nunique_people_this_faculty_member_can_see_risk_for.intent_to_leave as intent_flag,\nelv.list_name as class_level\nfrom person p\nLEFT JOIN org_person_student os on (os.person_id = p.id and os.organization_id = p.organization_id )         \njoin\n(\n   select person_id, max(intent_to_leave) as intent_to_leave\n   from\n   (\n      select\n      ocs.person_id, flags.intent_to_leave\n      from org_course_student ocs\n      join\n      (\n         select\n         ocf.org_courses_id, op.intent_to_leave\n         from org_course_faculty ocf\n         join org_courses oc on oc.id = ocf.org_courses_id and oc.deleted_at is null\n         join org_academic_terms oat on oat.id = oc.org_academic_terms_id and oat.deleted_at is null\n         join org_permissionset op on ocf.org_permissionset_id = op.id and op.deleted_at is null\n         where ocf.person_id = $$personId$$\n         and ocf.deleted_at is null\n         and oat.end_date >= date(now())\n         and op.risk_indicator = 1\n         and op.accesslevel_ind_agg = 1\n      )\n      flags on flags.org_courses_id = ocs.org_courses_id and ocs.deleted_at is null\n      union\n      all\n      select\n      ogs.person_id, flags.intent_to_leave\n      from org_group_students ogs\n      join\n      (\n         select\n         ogf.org_group_id, op.intent_to_leave\n         from org_group_faculty ogf\n         join org_permissionset op on ogf.org_permissionset_id = op.id and op.deleted_at is null\n         where ogf.person_id = $$personId$$\n         and ogf.deleted_at is null\n         and op.risk_indicator = 1\n         and op.accesslevel_ind_agg = 1\n      )\n      flags on flags.org_group_id = ogs.org_group_id and ogs.deleted_at is null\n   )\n   non_unique_people_this_faculty_member_can_see_risk_for\n   group by person_id\n)\nunique_people_this_faculty_member_can_see_risk_for on p.id = unique_people_this_faculty_member_can_see_risk_for.person_id\nleft join risk_level rl on p.risk_level = rl.id\nleft join Logins_count lc on lc.person_id = p.id\njoin org_person_student ops on ops.person_id = p.id and ops.deleted_at is null\nleft join intent_to_leave itl on itl.id = p.intent_to_leave\nleft join person_ebi_metadata pem on ( pem.person_id = p.id and pem.ebi_metadata_id = [EBI_METADATA_CLASSLEVEL_ID] )\nleft join ebi_metadata_list_values elv on (elv.list_value = pem.metadata_value and elv.ebi_metadata_id = [EBI_METADATA_CLASSLEVEL_ID] )\nwhere (p.risk_level in ($$risklevel$$) or p.risk_level is null)\nand p.deleted_at is null AND (os.status is null or os.status = 1) AND os.organization_id =  $$orgId$$ and os.deleted_at is null\n[ORDER_BY]\n[LIMIT]\n'),
(38,NULL,NULL,NULL,NULL,NULL,NULL,'My_Total_students_List_By_RiskLevel','E',1,'\nselect\nSQL_CALC_FOUND_ROWS p.id,\np.id,\np.firstname,\np.lastname,\np.risk_level,\nitl.image_name as intent_imagename,\nitl.text as intent_text,\nrl.image_name as risk_imagename,\nrl.risk_text,\np.intent_to_leave as intent_leave,\nlc.cnt as login_cnt,\np.cohert,\np.last_activity,\nops.status,\nitl.color_hex as intent_color,\nrl.color_hex as risk_color,\n1 as risk_flag,\nunique_people_this_faculty_member_can_see_risk_for.intent_to_leave as intent_flag,\nelv.list_name as class_level\nfrom person p\nLEFT JOIN org_person_student os on (os.person_id = p.id and os.organization_id = p.organization_id )        \njoin\n(\n   select person_id, max(intent_to_leave) as intent_to_leave\n   from\n   (\n      select\n      ocs.person_id, flags.intent_to_leave\n      from org_course_student ocs\n      join\n      (\n         select\n         ocf.org_courses_id, op.intent_to_leave\n         from org_course_faculty ocf\n         join org_courses oc on oc.id = ocf.org_courses_id and oc.deleted_at is null\n         join org_academic_terms oat on oat.id = oc.org_academic_terms_id and oat.deleted_at is null\n         join org_permissionset op on ocf.org_permissionset_id = op.id and op.deleted_at is null\n         where ocf.person_id = $$personId$$\n         and ocf.deleted_at is null\n         and oat.end_date >= date(now())\n         and op.risk_indicator = 1\n         and op.accesslevel_ind_agg = 1\n      )\n      flags on flags.org_courses_id = ocs.org_courses_id and ocs.deleted_at is null\n      union\n      all\n      select\n      ogs.person_id, flags.intent_to_leave\n      from org_group_students ogs\n      join\n      (\n         select\n         ogf.org_group_id, op.intent_to_leave\n         from org_group_faculty ogf\n         join org_permissionset op on ogf.org_permissionset_id = op.id and op.deleted_at is null\n         where ogf.person_id = $$personId$$\n         and ogf.deleted_at is null\n         and op.risk_indicator = 1\n         and op.accesslevel_ind_agg = 1\n      )\n      flags on flags.org_group_id = ogs.org_group_id and ogs.deleted_at is null\n   )\n   non_unique_people_this_faculty_member_can_see_risk_for\n   group by person_id\n)\nunique_people_this_faculty_member_can_see_risk_for on p.id = unique_people_this_faculty_member_can_see_risk_for.person_id\nleft join risk_level rl on p.risk_level = rl.id\nleft join Logins_count lc on lc.person_id = p.id\njoin org_person_student ops on ops.person_id = p.id and ops.deleted_at is null\nleft join intent_to_leave itl on itl.id = p.intent_to_leave\nleft join person_ebi_metadata pem on (pem.person_id = p.id and pem.ebi_metadata_id= [EBI_METADATA_CLASSLEVEL_ID] )\nleft join ebi_metadata_list_values elv on (elv.list_value = pem.metadata_value and elv.ebi_metadata_id = [EBI_METADATA_CLASSLEVEL_ID] )\nwhere p.deleted_at is null AND [RISK_LEVEL] AND (os.status is null or os.status = 1) AND os.organization_id =  $$orgId$$ and os.deleted_at is null\n[ORDER_BY]\n[LIMIT]\n'),
(39,NULL,NULL,NULL,NULL,NULL,NULL,'My_Open_Referrals_Received_List','E',1,'select \n    r.id as \'referral_id\',\n    r.person_id_student,\n    p.firstname,\n    p.lastname,\n    p.risk_level,\n    p.intent_to_leave,\n    rml.image_name,\n    rml.risk_text,\n    lc.cnt as login_cnt,\n    p.cohert,\n    p.last_activity\nFROM\n    referrals r\n        join\n    person p ON (r.person_id_student = p.id)\n        left join\n    referral_routing_rules rr ON (rr.activity_category_id = r.activity_category_id)\n        left join\n    organization_role orgr ON (r.organization_id = orgr.organization_id)\n        left join\n    risk_level rml ON (p.risk_level = rml.id)\n        left outer join\n    Logins_count lc ON (lc.person_id = r.person_id_student)\nwhere\n    r.deleted_at IS NULL AND r.status = \'O\'\n        and (r.person_id_assigned_to = $$personid$$\n        or (rr.person_id = $$personid$$\n        and r.person_id_assigned_to is null\n        and (rr.is_primary_coordinator = 0\n        or rr.is_primary_coordinator is null))\n        or (orgr.person_id = $$personid$$\n        and r.person_id_assigned_to is null\n        and orgr.role_id = 1\n        and (rr.is_primary_coordinator = 1\n        AND rr.person_id IS null)))\n		AND r.organization_id = $$orgid$$\ngroup by r.id -- maxscale route to server slave1 '),
(40,NULL,NULL,NULL,NULL,NULL,NULL,'My_Open_Referrals_Sent_List','E',1,'select r.id as \'referral_id\',r.person_id_student, p.firstname, p.lastname, p.risk_level, p.intent_to_leave,rml.image_name, rml.risk_text,lc.cnt as login_cnt, p.cohert, p.last_activity  FROM referrals r  join person p on (r.person_id_student = p.id ) LEFT join risk_level rml on (p.risk_level = rml.id) left outer join Logins_count lc on (lc.person_id = r.person_id_student)  where  r.deleted_at IS NULL AND (r.status = \'O\' or r.status=\'R\') and r.person_id_faculty = $$personid$$ -- maxscale route to server slave1 '),
(41,NULL,NULL,NULL,NULL,NULL,NULL,'Student_Profile_Datablock_Info','E',1,'select mm.id,\n                                mm.metadata_type,\n                                dml.datablock_desc as blockdesc,\n                                mml.meta_name,\n                                pm.metadata_value as myanswer,\n                                oay.name AS meta_year,\n                                oat.name AS meta_term,\n                                mm.scope\n                                from datablock_master dm\n                                JOIN datablock_master_lang dml ON dm.id = dml.datablock_id\n                                JOIN  datablock_metadata dmd ON dmd.datablock_id = dm.id\n                                JOIN ebi_metadata mm ON dmd.ebi_metadata_id = mm.id\n                                JOIN ebi_metadata_lang mml ON mml.ebi_metadata_id = mm.id\n                                JOIN person_ebi_metadata pm ON pm.ebi_metadata_id = mm.id\n                                LEFT JOIN org_academic_year oay ON pm.org_academic_year_id = oay.id\n                                LEFT JOIN org_academic_terms oat ON oat.id = pm.org_academic_terms_id\n                                where mml.lang_id= $$lang$$\n                                AND dm.block_type= \'profile\'\n                                AND pm.person_id = $$studentid$$\n                                AND dm.id IN($$datablockpermission$$)\n                                AND dm.deleted_at IS NULL\n                                AND  dml.deleted_at IS NULL\n                                AND dmd.deleted_at IS NULL\n                                AND mm.deleted_at IS NULL\n                                AND mml.deleted_at IS NULL\n                                AND pm.deleted_at IS NULL   -- maxscale route to server slave1\n                                '),
(42,NULL,NULL,NULL,NULL,NULL,NULL,'Student_Profile_ISP_Info','E',1,'select mm.id,mm.metadata_type,mm.meta_name,pm.metadata_value as myanswer from  org_metadata mm JOIN person_org_metadata pm ON pm.org_metadata_id = mm.id  where mm.definition_type=\"O\" AND pm.person_id = $$studentid$$ AND mm.id IN($$isppermission$$) AND mm.deleted_at IS NULL AND pm.deleted_at IS NULL -- maxscale route to server slave1 '),
(43,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_All','E',1,'Select * from ((SELECT A.id AS AppointmentId, N.id AS NoteId, R.id AS ReferralId, C.id AS ContactId, AL.id AS activity_log_id, AL.created_at AS activity_date, AL.activity_type AS activity_type, AL.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, C.contact_types_id AS activity_contact_type_id, CTL.description AS activity_contact_type_text, R.status AS activity_referral_status, C.note AS contactDescription, R.note AS referralDescription, A.description AS appointmentDescription, N.note AS noteDescription, AL.created_at as created_date, E.id AS EmailId, E.email_subject AS activity_email_subject, E.email_body AS activity_email_body, A.start_date_time as app_created_date, C.contact_date as contact_created_date, AL.activity_date as act_date FROM activity_log AS AL LEFT JOIN appointment_recepient_and_status as ARS ON (AL.appointments_id = ARS.appointments_id) AND (ARS.deleted_at IS NULL) LEFT JOIN Appointments as A ON (ARS.appointments_id = A.id) LEFT JOIN appointments_teams AS APT ON A.id = APT.appointments_id LEFT JOIN note AS N ON AL.note_id = N.id LEFT JOIN note_teams AS NT ON N.id = NT.note_id LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN email AS E ON AL.email_id = E.id LEFT JOIN email_teams AS ET ON E.id = ET.email_id LEFT JOIN referrals AS R ON AL.referrals_id = R.id LEFT JOIN referrals_teams AS RT ON R.id = RT.referrals_id LEFT JOIN activity_category AS AC ON A.activity_category_id = AC.id OR N.activity_category_id = AC.id OR R.activity_category_id = AC.id OR C.activity_category_id = AC.id OR E.activity_category_id = AC.id LEFT JOIN person AS P ON AL.person_id_faculty = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN organization_role as orgr ON orgr.organization_id = AL.organization_id LEFT JOIN referral_routing_rules as rr ON rr.activity_category_id = R.activity_category_id WHERE AL.person_id_student = $$studentId$$ AND AL.organization_id = $$orgId$$ AND AL.activity_type IN ($$acivityArr$$) AND AL.deleted_at IS NULL AND A.deleted_at IS NULL AND N.deleted_at IS NULL AND C.deleted_at IS NULL AND R.deleted_at IS NULL AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related INNER JOIN activity_log AS ALOG ON related.note_id = ALOG.note_id WHERE related.note_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related INNER JOIN activity_log AS ALOG ON related.contacts_id = ALOG.contacts_id WHERE related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related INNER JOIN activity_log AS ALOG ON related.email_id = ALOG.email_id WHERE related.email_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related INNER JOIN activity_log AS ALOG ON related.referral_id = ALOG.referrals_id WHERE related.referral_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related INNER JOIN activity_log AS ALOG ON related.appointment_id = ALOG.appointments_id WHERE related.appointment_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND (CASE WHEN AL.activity_type = \"N\" THEN CASE WHEN N.access_team = 1 THEN NT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM note_teams WHERE note_id = N.id AND deleted_at IS NULL)) AND $$noteTeamAccess$$ = 1 ELSE CASE WHEN N.access_private = 1 THEN N.person_id_faculty = $$faculty$$ ELSE N.access_public = 1 AND $$notePublicAccess$$ = 1 END END OR N.person_id_faculty = $$faculty$$ ELSE CASE WHEN AL.activity_type = \"C\" THEN CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM contacts_teams WHERE contacts_id = C.id AND deleted_at IS NULL)) AND $$contactTeamAccess$$ = 1 ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$faculty$$ ELSE C.access_public = 1 AND $$contactPublicAccess$$ = 1 END END OR C.person_id_faculty = $$faculty$$ ELSE CASE WHEN AL.activity_type = \"E\" THEN CASE WHEN E.access_team = 1 THEN ET.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM email_teams WHERE email_id = E.id AND deleted_at IS NULL)) AND $$emailTeamAccess$$ = 1 ELSE CASE WHEN E.access_private = 1 THEN E.person_id_faculty = $$faculty$$ ELSE E.access_public = 1 AND $$emailPublicAccess$$ = 1 END END OR E.person_id_faculty = $$faculty$$ ELSE CASE WHEN AL.activity_type = \"R\" THEN CASE WHEN R.access_team = 1 THEN RT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM referrals_teams WHERE referrals_id = R.id AND deleted_at IS NULL)) AND (($$referralTeamAccess$$ = 1 and is_reason_routed = 0) OR ($$referralTeamAccessReasonRouted$$ = 1 and is_reason_routed = 1)) ELSE CASE WHEN R.access_private = 1 THEN R.person_id_faculty = $$faculty$$ ELSE R.access_public = 1 AND (($$referralPublicAccess$$ = 1 and is_reason_routed = 0) OR ($$referralPublicAccessReasonRouted$$ = 1 and is_reason_routed = 1)) END END OR R.person_id_assigned_to = $$faculty$$ OR R.person_id_faculty = $$faculty$$ OR (orgr.person_id = $$faculty$$ AND orgr.role_id IN ($$roleIds$$) and R.person_id_student = $$studentId$$) ELSE CASE WHEN AL.activity_type = \"A\" THEN CASE WHEN A.access_team = 1 THEN APT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM appointments_teams WHERE appointments_id = A.id AND deleted_at IS NULL)) AND $$appointmentTeamAccess$$ = 1 ELSE CASE WHEN A.access_private = 1 THEN ARS.person_id_faculty = $$faculty$$ ELSE A.access_public = 1 AND $$appointmentPublicAccess$$ = 1 END END ELSE 1 = 1 END END END END END) GROUP BY AL.id) UNION ALL (SELECT null, null, R.id AS ReferralId, null, AL.id AS activity_log_id, AL.created_at AS activity_date, AL.activity_type AS activity_type, AL.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, null, null, R.status AS activity_referral_status, null, R.note AS referralDescription, null, null, AL.created_at as created_date, null, null, null, null, null, AL.activity_date as act_date FROM activity_log AS AL LEFT JOIN referrals AS R ON AL.referrals_id = R.id LEFT JOIN referrals_teams AS RT ON R.id = RT.referrals_id LEFT JOIN activity_category AS AC ON R.activity_category_id = AC.id LEFT JOIN person AS P ON AL.person_id_faculty = P.id LEFT JOIN referrals_interested_parties as rip ON rip.person_id = $$faculty$$ and R.id = rip.referrals_id where rip.person_id = $$faculty$$ and R.person_id_student = $$studentId$$ and rip.deleted_at is null and (CASE WHEN R.access_team = 1 THEN RT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM referrals_teams WHERE referrals_id = R.id AND deleted_at IS NULL)) AND (($$referralTeamAccess$$ = 1 and is_reason_routed = 0) OR ($$referralTeamAccessReasonRouted$$ = 1 and is_reason_routed = 1)) ELSE CASE WHEN R.access_private = 1 THEN (R.person_id_faculty = $$faculty$$ OR rip.person_id = $$faculty$$) ELSE R.access_public = 1 AND (($$referralPublicAccess$$ = 1 and is_reason_routed = 0) OR ($$referralPublicAccessReasonRouted$$ = 1 and is_reason_routed = 1)) END END))) merger group by activity_log_id ORDER BY act_date DESC'),
(44,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_Note','E',1,'\nSELECT N.id AS activity_id, AL.id AS activity_log_id, N.note_date AS activity_date, N.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, N.note AS activity_description FROM activity_log AS AL LEFT JOIN note AS N ON AL.note_id = N.id LEFT JOIN person AS P ON N.person_id_faculty = P.id LEFT JOIN activity_category AS AC ON N.activity_category_id = AC.id LEFT JOIN note_teams AS NT ON N.id = NT.note_id LEFT JOIN related_activities as RA ON N.id  = RA.note_id LEFT JOIN activity_log AL1 ON  RA.activity_log_id = AL1.id LEFT JOIN referrals AS R ON  AL1.referrals_id = R.id LEFT JOIN note AS N1 ON  AL1.note_id = N1.id LEFT JOIN contacts AS C ON  AL1.contacts_id = C.id LEFT JOIN Appointments AS A ON  AL1.appointments_id = A.id WHERE AL.person_id_student = $$studentId$$ /*Student id in request parameter */ AND AL.deleted_at IS NULL AND N.deleted_at IS NULL AND ( CASE WHEN AL1.activity_type IS NOT NULL AND ((AL1.activity_type = \"R\" AND R.access_private = 1) OR (AL1.activity_type = \"C\" AND C.access_private = 1) OR (AL1.activity_type = \"N\" AND N.access_private = 1)) THEN N.person_id_faculty = $$faculty$$ ELSE CASE WHEN N.access_team = 1 THEN NT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from note_teams WHERE note_id = N.id AND deleted_at IS NULL))AND $$teamAccess$$ = 1 /* logged in person id*/ ELSE CASE WHEN N.access_private = 1 THEN N.person_id_faculty = $$faculty$$ /* logged in person id*/ ELSE N.access_public = 1 AND $$publicAccess$$ = 1 END END END OR N.person_id_faculty = $$faculty$$) GROUP BY N.id order by N.note_date desc\n     -- maxscale route to server slave1 '),
(45,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_Contact','E',1,'\nSELECT C.id AS activity_id, AL.id AS activity_log_id, C.contact_date AS activity_date, C.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, C.note AS activity_description, C.contact_types_id AS activity_contact_type_id, CTL.description AS activity_contact_type_text , C.contact_date as contact_created_date  FROM activity_log AS AL LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN person AS P ON C.person_id_faculty = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN activity_category AS AC ON C.activity_category_id = AC.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN related_activities as RA ON C.id = RA.contacts_id LEFT JOIN activity_log AL1 ON RA.activity_log_id = AL1.id LEFT JOIN referrals AS R1 ON AL1.referrals_id = R1.id LEFT JOIN note AS N1 ON AL1.note_id = N1.id LEFT JOIN contacts AS C1 ON AL1.contacts_id = C1.id LEFT JOIN Appointments AS A1 ON AL1.appointments_id = A1.id WHERE C.person_id_student = $$studentId$$ AND C.deleted_at IS NULL AND ( CASE WHEN AL1.activity_type IS NOT NULL AND ((AL1.activity_type = \"R\" AND R1.access_private = 1) OR (AL1.activity_type = \"C\" AND C1.access_private = 1) OR (AL1.activity_type = \"N\" AND N1.access_private = 1)) THEN C.person_id_faculty = $$facultyId$$ ELSE CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$facultyId$$ AND teams_id IN (SELECT teams_id from contacts_teams WHERE contacts_id = C.id AND deleted_at IS NULL)) AND $$teamAccess$$ = 1 ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$facultyId$$ ELSE C.access_public = 1 AND $$publicAccess$$ = 1 END END END OR C.person_id_faculty = $$facultyId$$) GROUP BY C.id order by C.contact_date desc\n     -- maxscale route to server slave1 '),
(46,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_Referral','E',1,'SELECT R.id AS activity_id, AL.id AS activity_log_id, R.referral_date AS activity_date, R.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, R.note AS activity_description, R.status AS activity_referral_status FROM activity_log AS AL LEFT JOIN referrals AS R ON AL.referrals_id = R.id LEFT JOIN person AS P ON R.person_id_faculty = P.id LEFT JOIN activity_category AS AC ON R.activity_category_id = AC.id LEFT JOIN referrals_teams AS RT ON R.id = RT.referrals_id LEFT JOIN organization_role as orgr ON orgr.organization_id = AL.organization_id LEFT JOIN referral_routing_rules as rr ON rr.activity_category_id = R.activity_category_id WHERE R.person_id_student = $$studentId$$ AND R.organization_id = $$orgId$$ AND R.deleted_at IS NULL AND (CASE WHEN access_team = 1 THEN RT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from referrals_teams WHERE referrals_id = R.id AND deleted_at IS NULL)) AND (($$teamAccess$$ = 1 and is_reason_routed = 0) OR ($$teamAccessReasonRouted$$ = 1 and is_reason_routed = 1)) ELSE CASE WHEN access_private = 1 THEN R.person_id_faculty = $$faculty$$ ELSE R.access_public = 1 AND (($$publicAccess$$ = 1 and is_reason_routed = 0) OR ($$publicAccessReasonRouted$$ = 1 and is_reason_routed = 1)) END END OR R.person_id_assigned_to = $$faculty$$ OR R.person_id_faculty = $$faculty$$ OR (orgr.person_id = $$faculty$$ AND orgr.role_id IN ($$roleIds$$) and R.person_id_student = $$studentId$$) OR (R.id IN (select rip.referrals_id from referrals_interested_parties as rip left join referrals as R2 ON R2.id = rip.referrals_id where rip.person_id = $$faculty$$ and R2.person_id_student = $$studentId$$ and rip.deleted_at is null and (CASE WHEN access_team = 1 THEN RT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from referrals_teams WHERE referrals_id = R.id AND deleted_at IS NULL)) AND (($$teamAccess$$ = 1 and is_reason_routed = 0) OR ($$teamAccessReasonRouted$$ = 1 and is_reason_routed = 1)) ELSE CASE WHEN access_private = 1 THEN (R.person_id_faculty = $$faculty$$ OR rip.person_id = $$faculty$$) ELSE R.access_public = 1 AND (($$publicAccess$$ = 1 and is_reason_routed = 0) OR ($$publicAccessReasonRouted$$ = 1 and is_reason_routed = 1)) END END)))) GROUP BY R.id order by R.referral_date desc'),
(47,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_Contact_Interaction','E',1,'\nSELECT C.id AS activity_id, AL.id AS activity_log_id, C.contact_date AS activity_date, C.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, C.note AS activity_description, C.contact_types_id AS activity_contact_type_id, CTL.description AS activity_contact_type_text ,C.contact_date as contact_created_date  FROM activity_log AS AL LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN person AS P ON C.person_id_faculty = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN activity_category AS AC ON C.activity_category_id = AC.id LEFT JOIN related_activities as RA ON C.id = RA.contacts_id LEFT JOIN activity_log AL1 ON RA.activity_log_id = AL1.id LEFT JOIN referrals AS R1 ON AL1.referrals_id = R1.id LEFT JOIN note AS N1 ON AL1.note_id = N1.id LEFT JOIN contacts AS C1 ON AL1.contacts_id = C1.id LEFT JOIN Appointments AS A1 ON AL1.appointments_id = A1.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN contact_types AS CONT ON C.contact_types_id = CONT.id WHERE C.person_id_student = $$studentId$$ /* Student id in request parameter */ AND (CONT.parent_contact_types_id = 1 OR CONT.parent_contact_types_id IS NULL) AND C.deleted_at IS NULL AND ( CASE WHEN AL1.activity_type IS NOT NULL AND ((AL1.activity_type = \"R\" AND R1.access_private = 1) OR (AL1.activity_type = \"C\" AND C1.access_private = 1) OR (AL1.activity_type = \"N\" AND N1.access_private = 1)) THEN C.person_id_faculty = $$facultyId$$ ELSE CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$facultyId$$ AND teams_id IN (SELECT teams_id from contacts_teams WHERE contacts_id = C.id AND deleted_at IS NULL)) AND $$teamAccess$$ = 1 ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$facultyId$$ ELSE C.access_public = 1 AND $$publicAccess$$ = 1 END END END OR C.person_id_faculty = $$facultyId$$) GROUP BY C.id order by C.contact_date desc\n -- maxscale route to server slave1 '),
(48,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_Count','E',1,'Select activity_type from (SELECT AL.activity_type AS activity_type, AL.id FROM activity_log AS AL LEFT JOIN appointment_recepient_and_status as ARS ON (AL.appointments_id = ARS.appointments_id) AND (ARS.deleted_at IS NULL) LEFT JOIN Appointments as A ON (ARS.appointments_id = A.id) LEFT JOIN appointments_teams AS APT ON A.id = APT.appointments_id LEFT JOIN note AS N ON AL.note_id = N.id LEFT JOIN note_teams AS NT ON N.id = NT.note_id LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN email AS E ON AL.email_id = E.id LEFT JOIN email_teams AS ET ON E.id = ET.email_id LEFT JOIN referrals AS R ON AL.referrals_id = R.id LEFT JOIN referrals_teams AS RT ON R.id = RT.referrals_id LEFT JOIN activity_category AS AC ON A.activity_category_id = AC.id OR N.activity_category_id = AC.id OR R.activity_category_id = AC.id OR C.activity_category_id = AC.id LEFT JOIN related_activities as RA ON (N.id = RA.note_id OR C.id = RA.contacts_id) LEFT JOIN activity_log AL1 ON RA.activity_log_id = AL1.id LEFT JOIN referrals AS R1 ON AL1.referrals_id = R1.id LEFT JOIN note AS N1 ON AL1.note_id = N1.id LEFT JOIN contacts AS C1 ON AL1.contacts_id = C1.id LEFT JOIN Appointments AS A1 ON AL1.appointments_id = A1.id LEFT JOIN person AS P ON AL.person_id_faculty = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN organization_role as orgr ON orgr.organization_id = AL.organization_id LEFT JOIN referral_routing_rules as rr ON rr.activity_category_id = R.activity_category_id WHERE AL.person_id_student = $$studentId$$ AND AL.organization_id = $$orgId$$ AND AL.activity_type IN ($$acivityArr$$) AND AL.deleted_at IS NULL AND A.deleted_at IS NULL AND N.deleted_at IS NULL AND C.deleted_at IS NULL AND R.deleted_at IS NULL AND (CASE WHEN AL.activity_type = \"N\" THEN CASE WHEN AL1.activity_type IS NOT NULL AND ((AL1.activity_type = \"R\" AND R1.access_private = 1) OR (AL1.activity_type = \"C\" AND C1.access_private = 1) OR (AL1.activity_type = \"N\" AND N1.access_private = 1)) THEN N.person_id_faculty = $$faculty$$ ELSE CASE WHEN N.access_team = 1 THEN NT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from note_teams WHERE note_id = N.id AND deleted_at IS NULL)) AND $$noteTeamAccess$$ = 1 ELSE CASE WHEN N.access_private = 1 THEN N.person_id_faculty = $$faculty$$ ELSE N.access_public = 1 AND $$notePublicAccess$$ = 1 END END END OR N.person_id_faculty = $$faculty$$ ELSE CASE WHEN AL.activity_type = \"C\" THEN CASE WHEN AL1.activity_type IS NOT NULL AND ((AL1.activity_type = \"R\" AND R1.access_private = 1) OR (AL1.activity_type = \"C\" AND C1.access_private = 1) OR (AL1.activity_type = \"N\" AND N1.access_private = 1)) THEN C.person_id_faculty = $$faculty$$ ELSE CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from contacts_teams WHERE contacts_id = C.id AND deleted_at IS NULL)) AND $$contactTeamAccess$$ = 1 ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$faculty$$ ELSE C.access_public = 1 AND $$contactPublicAccess$$ = 1 END END END OR C.person_id_faculty = $$faculty$$ ELSE CASE WHEN AL.activity_type = \"E\" THEN CASE WHEN AL1.activity_type IS NOT NULL AND ((AL1.activity_type = \"R\" AND R1.access_private = 1) OR (AL1.activity_type = \"C\" AND C1.access_private = 1) OR (AL1.activity_type = \"N\" AND N1.access_private = 1)) THEN E.person_id_faculty = $$faculty$$ ELSE CASE WHEN E.access_team = 1 THEN ET.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from email_teams WHERE email_id = E.id AND deleted_at IS NULL)) AND $$emailTeamAccess$$ = 1 ELSE CASE WHEN E.access_private = 1 THEN E.person_id_faculty = $$faculty$$ ELSE E.access_public = 1 AND $$emailPublicAccess$$ = 1 END END END OR E.person_id_faculty = $$faculty$$ ELSE CASE WHEN AL.activity_type = \"R\" THEN CASE WHEN R.access_team = 1 THEN RT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from referrals_teams WHERE referrals_id = R.id AND deleted_at IS NULL)) AND (($$referralTeamAccess$$ = 1 and R.is_reason_routed = 0) OR ($$referralTeamAccessReasonRouted$$ = 1 and R.is_reason_routed = 1)) ELSE CASE WHEN R.access_private = 1 THEN R.person_id_faculty = $$faculty$$ ELSE R.access_public = 1 AND (($$referralPublicAccess$$ = 1 and R.is_reason_routed = 0) OR ($$referralPublicAccessReasonRouted$$ = 1 and R.is_reason_routed = 1)) END END OR R.person_id_assigned_to = $$faculty$$ OR R.person_id_faculty = $$faculty$$ OR (orgr.person_id = $$faculty$$ AND orgr.role_id IN ($$roleIds$$) and R.person_id_student = $$studentId$$) ELSE CASE WHEN AL.activity_type = \"A\" THEN CASE WHEN A.access_team = 1 THEN APT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from appointments_teams WHERE appointments_id = A.id AND deleted_at IS NULL)) AND $$appointmentTeamAccess$$ = 1 ELSE CASE WHEN A.access_private = 1 THEN ARS.person_id_faculty = $$faculty$$ ELSE A.access_public = 1 AND $$appointmentPublicAccess$$ = 1 END END ELSE 1 = 1 END END END END END) GROUP BY AL.id UNION ALL (select \"R\" as activity_type, AL.id from referrals_interested_parties as rip left join referrals as R2 ON R2.id = rip.referrals_id LEFT JOIN activity_log AS AL ON AL.referrals_id = R2.id LEFT JOIN referrals_teams AS RT ON R2.id = RT.referrals_id where rip.person_id = $$faculty$$ and R2.person_id_student = $$studentId$$ and rip.deleted_at is null and (CASE WHEN R2.access_team = 1 THEN RT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id from referrals_teams WHERE referrals_id = R2.id AND deleted_at IS NULL)) AND (($$referralTeamAccess$$ = 1 and R2.is_reason_routed = 0) OR ($$referralTeamAccessReasonRouted$$ = 1 and R2.is_reason_routed = 1)) ELSE CASE WHEN R2.access_private = 1 THEN (R2.person_id_faculty = $$faculty$$ OR rip.person_id = $$faculty$$) ELSE R2.access_public = 1 AND (($$referralPublicAccess$$ = 1 and R2.is_reason_routed = 0) OR ($$referralPublicAccessReasonRouted$$ = 1 and R2.is_reason_routed = 1)) END END))) merged group by id , activity_type'),
(49,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_Contact_Int_Count','E',1,'SELECT COUNT(DISTINCT(C.id)) AS cnt FROM activity_log AS AL LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN person AS P ON C.person_id_faculty = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN activity_category AS AC ON C.activity_category_id = AC.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN related_activities as RA ON C.id = RA.contacts_id LEFT JOIN activity_log AL1 ON RA.activity_log_id = AL1.id LEFT JOIN referrals AS R1 ON AL1.referrals_id = R1.id LEFT JOIN note AS N1 ON AL1.note_id = N1.id LEFT JOIN contacts AS C1 ON AL1.contacts_id = C1.id LEFT JOIN Appointments AS A1 ON AL1.appointments_id = A1.id LEFT JOIN contact_types AS CONT ON C.contact_types_id = CONT.id WHERE C.person_id_student = $$studentId$$ /* Student id in request parameter */ AND (CONT.parent_contact_types_id = 1 OR CONT.parent_contact_types_id IS NULL)/* is interaction */ AND C.deleted_at IS NULL AND (CASE WHEN AL1.activity_type IS NOT NULL AND ((AL1.activity_type = \"R\" AND R1.access_private = 1) OR (AL1.activity_type = \"C\" AND C1.access_private = 1) OR (AL1.activity_type = \"N\" AND N1.access_private = 1)) THEN C.person_id_faculty = $$facultyId$$ ELSE CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$facultyId$$ AND teams_id IN (SELECT teams_id FROM contacts_teams WHERE contacts_id = C.id AND deleted_at IS NULL)) AND $$teamAccess$$ = 1 ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$facultyId$$  ELSE C.access_public = 1 AND $$publicAccess$$ = 1 END END END OR C.person_id_faculty = $$facultyId$$) -- maxscale route to server slave1 '),
(50,NULL,NULL,NULL,NULL,NULL,NULL,'Coordinator_Activity_All','E',1,'SELECT A.id as AppointmentId, N.id as NoteId,R.id as ReferralId,C.id  as ContactId,AL.id as activity_log_id,AL.created_at as activity_date,AL.activity_type  as activity_type,AL.person_id_faculty as activity_created_by_id,P.firstname as activity_created_by_first_name,P.lastname as activity_created_by_last_name,AC.id as activity_reason_id,AC.short_name as activity_reason_text,C.contact_types_id as activity_contact_type_id,CTL.description  as activity_contact_type_text,R.status as activity_referral_status,C.note as contactDescription,R.note as referralDescription,A.description as appointmentDescription,N.note as noteDescription FROM activity_log as AL LEFT JOIN Appointments as A ON AL.appointments_id = A.id LEFT JOIN note as N ON AL.note_id = N.id LEFT JOIN note_teams  as NT ON N.id = NT.note_id LEFT JOIN contacts as C ON AL.contacts_id = C.id LEFT JOIN contacts_teams  as CT ON C.id = CT.contacts_id LEFT JOIN referrals as R ON AL.referrals_id = R.id LEFT JOIN referrals_teams  as RT ON R.id = RT.referrals_id LEFT JOIN activity_category as AC ON A.activity_category_id = AC.id OR N.activity_category_id = AC.id OR R.activity_category_id = AC.id OR C.activity_category_id = AC.id LEFT JOIN person as P ON AL.person_id_faculty = P.id LEFT JOIN contact_types_lang as CTL ON C.contact_types_id = CTL.contact_types_id WHERE AL.person_id_student = $$studentId$$ AND AL.organization_id = $$orgId$$ AND AL.activity_type IN ($$acivityArr$$) AND AL.deleted_at IS NULL AND A.deleted_at IS NULL AND N.deleted_at IS NULL AND C.deleted_at IS NULL AND R.deleted_at IS NULL AND  AL.id NOT IN( SELECT ALOG.id  FROM  related_activities as related  LEFT JOIN activity_log as ALOG ON related.note_id = ALOG.note_id where related.note_id IS NOT NULL  AND related.deleted_at IS NULL  AND ALOG.deleted_at IS NULL)  AND  AL.id NOT IN( SELECT ALOG.id  FROM  related_activities as related LEFT JOIN activity_log as ALOG ON related.contacts_id = ALOG.contacts_id where related.contacts_id IS NOT NULL  AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) GROUP BY AL.id ORDER BY AL.created_at desc -- maxscale route to server slave1 '),
(51,NULL,NULL,NULL,NULL,NULL,NULL,'Coordinator_Activity_Note','E',1,'SELECT N.id as activity_id,AL.id as activity_log_id,  N.created_at as  activity_date,  N.person_id_faculty as activity_created_by_id , P.firstname as activity_created_by_first_name, P.lastname as activity_created_by_last_name, AC.id as activity_reason_id, AC.short_name as activity_reason_text, N.note as activity_description FROM activity_log as AL  LEFT JOIN note as N ON  AL.note_id = N.id LEFT JOIN person as P ON  N.person_id_faculty = P.id LEFT JOIN activity_category as AC ON N.activity_category_id  = AC.id LEFT JOIN note_teams  as NT ON N.id = NT.note_id WHERE AL.person_id_student = $$studentId$$ /*Student id in request parameter */ AND AL.deleted_at IS NULL AND N.deleted_at IS NULL AND AL.activity_type = \"N\" AND AL.id NOT IN(SELECT ALOG.id  FROM  related_activities as related LEFT JOIN activity_log as ALOG ON related.note_id = ALOG.note_id	where related.note_id IS NOT NULL 	AND related.deleted_at IS NULL 	AND ALOG.deleted_at IS NULL) GROUP BY N.id -- maxscale route to server slave1 '),
(52,NULL,NULL,NULL,NULL,NULL,NULL,'Coordinator_Activity_Contact','E',1,'SELECT  C.id as activity_id, AL.id as activity_log_id, C.created_at as  activity_date, C.person_id_faculty as activity_created_by_id , P.firstname as activity_created_by_first_name, P.lastname as activity_created_by_last_name, AC.id as activity_reason_id, AC.short_name as activity_reason_text, C.note as activity_description, C.contact_types_id  as activity_contact_type_id,CTL.description  as activity_contact_type_text FROM activity_log as AL LEFT JOIN contacts as C ON  AL.contacts_id = C.id LEFT JOIN person as P  ON C.person_id_faculty = P.id  LEFT JOIN contact_types_lang as CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN activity_category as AC ON C.activity_category_id  =  AC.id LEFT JOIN contacts_teams  as CT ON C.id = CT.contacts_id  WHERE C.person_id_student  = $$studentId$$ AND C.deleted_at  IS NULL AND  AL.id NOT IN(SELECT ALOG.id  FROM  related_activities as related LEFT JOIN activity_log as ALOG ON related.contacts_id = ALOG.contacts_id where related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) GROUP BY C.id -- maxscale route to server slave1 '),
(53,NULL,NULL,NULL,NULL,NULL,NULL,'Coordinator_Activity_Referral','E',1,'SELECT R.id as activity_id,AL.id as activity_log_id,R.created_at as  activity_date,R.person_id_faculty as activity_created_by_id ,P.firstname as activity_created_by_first_name,P.lastname as activity_created_by_last_name,AC.id as activity_reason_id,AC.short_name as activity_reason_text, R.note as activity_description,R.status as activity_referral_status FROM activity_log as AL LEFT JOIN referrals as R ON  AL.referrals_id = R.id LEFT JOIN person as P ON  R.person_id_faculty = P.id LEFT JOIN activity_category as AC ON R.activity_category_id  =  AC.id LEFT JOIN referrals_teams  as RT ON R.id = RT.referrals_id  WHERE R.person_id_student = $$studentId$$ /* Student id in request parameter */ AND R.deleted_at IS NULL GROUP BY R.id -- maxscale route to server slave1 '),
(54,NULL,NULL,NULL,NULL,NULL,NULL,'Coordinator_Activity_Contact_Interaction','E',1,'SELECT C.id as activity_id, AL.id as activity_log_id,C.created_at as  activity_date,C.person_id_faculty as activity_created_by_id ,P.firstname as activity_created_by_first_name,P.lastname as activity_created_by_last_name,AC.id as activity_reason_id,AC.short_name as activity_reason_text,C.note as activity_description,C.contact_types_id  as activity_contact_type_id,CTL.description  as activity_contact_type_text FROM activity_log as AL LEFT JOIN contacts as C ON  AL.contacts_id = C.id LEFT JOIN person as P  ON C.person_id_faculty = P.id LEFT JOIN contact_types_lang as CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN activity_category as AC ON C.activity_category_id  =  AC.id LEFT JOIN contacts_teams  as CT ON C.id = CT.contacts_id LEFT JOIN contact_types  as CONT ON C.contact_types_id = CONT.id WHERE C.person_id_student  = $$studentId$$ /* Student id in request parameter */ AND (CONT.parent_contact_types_id = 1 OR CONT.parent_contact_types_id IS NULL) /* is interaction */ AND C.deleted_at  IS NULL AND  AL.id NOT IN( SELECT ALOG.id  FROM  related_activities as related LEFT JOIN activity_log as ALOG ON related.contacts_id = ALOG.contacts_id where related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) GROUP BY C.id -- maxscale route to server slave1 '),
(55,NULL,NULL,NULL,NULL,NULL,NULL,'Coordinator_Activity_Count','E',1,'SELECT  AL.activity_type as activity_type FROM activity_log as AL LEFT JOIN Appointments as A ON AL.appointments_id = A.id LEFT JOIN note as N ON AL.note_id = N.id LEFT JOIN note_teams  as NT ON N.id = NT.note_id LEFT JOIN contacts as C ON AL.contacts_id = C.id LEFT JOIN contacts_teams  as CT ON C.id = CT.contacts_id LEFT JOIN referrals as R ON AL.referrals_id = R.id LEFT JOIN referrals_teams  as RT ON R.id = RT.referrals_id LEFT JOIN activity_category as AC ON A.activity_category_id = AC.id OR N.activity_category_id = AC.id OR R.activity_category_id = AC.id OR C.activity_category_id = AC.id LEFT JOIN person as P ON AL.person_id_faculty = P.id LEFT JOIN contact_types_lang as CTL ON C.contact_types_id = CTL.contact_types_id WHERE AL.person_id_student = $$studentId$$ AND AL.organization_id = $$orgId$$ AND AL.activity_type IN ($$acivityArr$$) AND AL.deleted_at IS NULL AND A.deleted_at IS NULL AND N.deleted_at IS NULL AND C.deleted_at IS NULL AND R.deleted_at IS NULL GROUP BY AL.id ORDER BY AL.created_at desc -- maxscale route to server slave1 '),
(56,NULL,NULL,NULL,NULL,NULL,NULL,'Coordinator_Activity_Contact_Int_Count','E',1,'SELECT COUNT(DISTINCT(C.id)) as cnt FROM activity_log as AL LEFT JOIN contacts as C ON  AL.contacts_id = C.id LEFT JOIN person as P  ON C.person_id_faculty = P.id LEFT JOIN contact_types_lang as CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN activity_category as AC ON C.activity_category_id  =  AC.id LEFT JOIN contacts_teams  as CT ON C.id = CT.contacts_id LEFT JOIN contact_types  as CONT ON C.contact_types_id = CONT.id WHERE C.person_id_student  = $$studentId$$ /* Student id in request parameter */ AND (CONT.parent_contact_types_id = 1 OR CONT.parent_contact_types_id IS NULL) /* is interaction */ AND C.deleted_at  IS NULL AND  AL.id NOT IN( SELECT ALOG.id  FROM  related_activities as related LEFT JOIN activity_log as ALOG ON related.contacts_id = ALOG.contacts_id where related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) -- maxscale route to server slave1 '),
(57,NULL,NULL,NULL,NULL,NULL,NULL,'All_My_Student','P',1,'SELECT SQL_CALC_FOUND_ROWS P.id , P.id AS student,  P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM person P LEFT JOIN  risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) where   P.id IN ($$personIds$$ ) GROUP BY P.id -- maxscale route to server slave1 '),
(58,NULL,NULL,NULL,NULL,NULL,NULL,'My_Primary_Campus_Connection','P',1,'SELECT SQL_CALC_FOUND_ROWS P.id , P.id AS student,  P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM person P LEFT JOIN  risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) where   OPS.person_id_primary_connect = $$facultyId$$ AND P.id IN ($$personIds$$ ) GROUP BY P.id -- maxscale route to server slave1 '),
(59,NULL,NULL,NULL,NULL,NULL,NULL,'Class_Level','P',1,'SELECT SQL_CALC_FOUND_ROWS P.id , P.id AS student,  P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM person P LEFT JOIN  risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN person_ebi_metadata AS PEM ON PEM.person_id = P.id LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) where   PEM.ebi_metadata_id IN (SELECT id FROM ebi_metadata WHERE meta_key=\"ClassLevel\") AND P.id IN ($$personIds$$ ) GROUP BY P.id -- maxscale route to server slave1 '),
