(61,NULL,NULL,NULL,NULL,NULL,NULL,'High_Priority_Students','P',1,'SELECT SQL_CALC_FOUND_ROWS\n    P.id,\n    P.id AS student,\n    P.firstname,\n    P.lastname,\n    P.risk_level,\n    RL.risk_text,\n    RL.image_name,\n    IL.text AS intent_to_leave_text,\n    IL.image_name AS intent_to_leave_image,\n    RML.risk_model_id,\n    P.last_activity,\n    OPS.surveycohort AS student_cohort,\n    (COUNT(DISTINCT (acl.id))) AS cnt,\n    OPS.status,\n    OPS.photo_url,\n    pem.metadata_value AS class_level\nFROM\n    person P\n        LEFT JOIN\n    risk_level AS RL ON P.risk_level = RL.id\n        LEFT JOIN\n    risk_model_levels AS RML ON RML.risk_level = RL.id\n        LEFT JOIN\n    intent_to_leave AS IL ON P.intent_to_leave = IL.id\n        LEFT JOIN\n    org_person_student AS OPS ON OPS.person_id = P.id\n        LEFT JOIN\n    activity_log acl ON (acl.person_id_student = P.id)\n        LEFT JOIN\n    person_ebi_metadata AS pem ON (pem.person_id = P.id\n        AND pem.ebi_metadata_id IN (SELECT \n            id\n        FROM\n            ebi_metadata\n        WHERE\n            meta_key = \'ClassLevel\'))\nWHERE\n    P.risk_level IN (1 , 2)\n        AND (P.risk_update_date > P.last_contact_date\n        OR P.last_contact_date IS NULL)\n        AND P.id IN ($$personIds$$)\nGROUP BY P.id -- maxscale route to server slave1 '),
(62,NULL,NULL,NULL,NULL,NULL,NULL,'Respondents_To_Current_Survey','P',1,'\nSELECT SQL_CALC_FOUND_ROWS P.id, P.id AS student, P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, ( SELECT RML.risk_model_id FROM risk_model_levels AS RML WHERE RML.risk_level = RL.id LIMIT 1) AS risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (COUNT(DISTINCT (acl.id))) AS cnt, OPS.status, OPS.photo_url, pem.metadata_value AS class_level FROM person P LEFT JOIN intent_to_leave AS IL FORCE INDEX (PRIMARY) ON P.intent_to_leave = IL.id LEFT JOIN risk_level AS RL FORCE INDEX (PRIMARY) ON P.risk_level = RL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl ON (acl.person_id_student = P.id) INNER JOIN survey_response AS SR ON SR.person_id = P.id INNER JOIN wess_link AS WL ON WL.survey_id = SR.survey_id LEFT JOIN person_ebi_metadata AS pem ON (pem.person_id = P.id AND pem.ebi_metadata_id IN (SELECT id FROM ebi_metadata WHERE meta_key = \"ClassLevel\")) WHERE P.id IN ($$personIds$$ ) AND WL.id = (SELECT id from wess_link where year_id = $$yearText$$ AND org_id = $$orgId$$ AND status in (\"launched\", \"closed\") ORDER BY close_date DESC LIMIT 1) GROUP BY P.id  \n'),
(63,NULL,NULL,NULL,NULL,NULL,NULL,'Non_Respondents_To_Current_Survey','P',1,'SELECT SQL_CALC_FOUND_ROWS P.id , P.id AS student,  P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM person P LEFT JOIN  risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN survey_response AS SR ON SR.person_id = P.id LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) where   P.id IN ($$personIds$$ ) AND P.id NOT IN (SELECT DISTINCT(person_id) FROM survey_response AS SR WHERE SR.org_id = $$orgId$$ AND SR.org_academic_year_id = $$yearId$$ AND SR.survey_id IN (SELECT DISTINCT(survey_id) FROM wess_link WHERE year_id = $$yearText$$ AND status= \"launched\" AND org_id = $$orgId$$)) GROUP BY P.id -- maxscale route to server slave1 '),
