(70,NULL,NULL,NULL,NULL,NULL,NULL,'Final_Grade_Of_C_Or_Below','P',1,'SELECT SQL_CALC_FOUND_ROWS P.id , P.id AS student,  P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM person P LEFT JOIN org_course_student OCS ON OCS.person_id = P.id LEFT JOIN org_courses OC ON OC.id = OCS.org_courses_id LEFT JOIN risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN academic_update AU ON (AU.person_id_student = P.id) LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) where OC.deleted_at IS NULL AND OCS.deleted_at IS NULL AND OC.org_academic_terms_id IN ($$termsId$$) AND P.id IN ($$personIds$$ ) AND AU.final_grade IN (\"C\", \"C-\", \"D+\", \"D\",\"D-\",\"F\", \"No Pass\",\"F/No Pass\") AND AU.update_date BETWEEN \"$$startDate$$\" AND \"$$endDate$$\" GROUP BY P.id -- maxscale route to server slave1 '),
