(72,NULL,NULL,NULL,NULL,NULL,NULL,'Final_Grade_Of_D_Or_Below','P',1,'SELECT SQL_CALC_FOUND_ROWS P.id , P.id AS student,  P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM person P LEFT JOIN org_course_student OCS ON OCS.person_id = P.id LEFT JOIN org_courses OC ON OC.id = OCS.org_courses_id LEFT JOIN risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN academic_update AU ON (AU.person_id_student = P.id) LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) where OC.deleted_at IS NULL AND OCS.deleted_at IS NULL AND OC.org_academic_terms_id IN ($$termsId$$) AND P.id IN ($$personIds$$ ) AND AU.final_grade IN (\"D\" ,\"D-\",\"F\", \"No Pass\", \"F/No Pass\") AND AU.update_date BETWEEN \"$$startDate$$\" AND \"$$endDate$$\" GROUP BY P.id -- maxscale route to server slave1 '),
(73,NULL,NULL,NULL,NULL,NULL,NULL,'Students_With_More_Than_One_In-progress_Grade_Of_D_Or_Below','P',1,'SELECT SQL_CALC_FOUND_ROWS T.student ,T.* , count(T.student) as t , (select count(*) from activity_log where person_id_student = T.student AND deleted_at IS NULL group BY person_id_student) as cnt from ( SELECT P.id AS student, P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, OPS.status, OPS.photo_url, pem.metadata_value AS class_level FROM synapse.academic_update AS AU LEFT JOIN person as P ON AU.person_id_student = P.id LEFT JOIN org_courses OC ON OC.id = AU.org_courses_id LEFT JOIN risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl ON (acl.person_id_student = P.id) LEFT JOIN person_ebi_metadata AS pem ON (pem.person_id = P.id AND pem.ebi_metadata_id IN (SELECT id FROM ebi_metadata WHERE meta_key =\"ClassLevel\")) where AU.person_id_student IN($$personIds$$) AND (AU.grade IS NOT NULL) AND AU.deleted_at IS NULL AND OC.deleted_at IS NULL AND OC.org_academic_terms_id IN ($$termsId$$) AND AU.update_date BETWEEN \"$$startDate$$\" AND \"$$endDate$$\" AND AU.grade IN (\"D\", \"F\", \"No Pass\",\"F/No Pass\") GROUP BY AU.org_courses_id,P.id ) AS T GROUP BY T.student HAVING T > 1 -- maxscale route to server slave1 '),
(74,NULL,NULL,NULL,NULL,NULL,NULL,'Students_With_More_Than_One_Final_Grade_Of_D_Or_Below','P',1,'SELECT SQL_CALC_FOUND_ROWS T.student ,T.* , count(T.student) as t , (select count(*) from activity_log where person_id_student = T.student AND deleted_at IS NULL group BY person_id_student) as cnt from ( SELECT P.id AS student, P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, OPS.status, OPS.photo_url, pem.metadata_value AS class_level FROM synapse.academic_update AS AU LEFT JOIN person as P ON AU.person_id_student = P.id LEFT JOIN org_courses OC ON OC.id = AU.org_courses_id LEFT JOIN risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl ON (acl.person_id_student = P.id) LEFT JOIN person_ebi_metadata AS pem ON (pem.person_id = P.id AND pem.ebi_metadata_id IN (SELECT id FROM ebi_metadata WHERE meta_key =\"ClassLevel\")) where AU.person_id_student IN($$personIds$$) AND (AU.final_grade IS NOT NULL) AND AU.deleted_at IS NULL AND OC.deleted_at IS NULL  AND OC.org_academic_terms_id IN ($$termsId$$) AND  AU.update_date BETWEEN \"$$startDate$$\" AND \"$$endDate$$\" AND AU.final_grade IN  (\"D\" ,\"D-\",\"F\", \"No Pass\",\"F/No Pass\") GROUP BY AU.org_courses_id,P.id ) AS T GROUP BY T.student HAVING T > 1 -- maxscale route to server slave1 '),
(75,NULL,NULL,NULL,NULL,NULL,NULL,'Interaction_Activity','P',1,'SELECT SQL_CALC_FOUND_ROWS C.person_id_student , C.person_id_faculty AS faculty, C.person_id_student AS student, P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM activity_log AS AL LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN person AS P ON C.person_id_student = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN activity_category AS AC ON C.activity_category_id = AC.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN contact_types AS CONT ON C.contact_types_id = CONT.id LEFT JOIN risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = C.person_id_student LEFT JOIN org_course_student AS OCS ON OCS.person_id = C.person_id_student LEFT JOIN org_courses AS OC ON (OCS.org_courses_id = OC.id) LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) WHERE (CONT.parent_contact_types_id = 1 OR CONT.id = 1) AND C.deleted_at IS NULL AND  C.person_id_student IN ($$personIds$$) AND acl.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.contacts_id = ALOG.contacts_id WHERE related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$facultyId$$) ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$facultyId$$  ELSE C.access_public = 1 END END GROUP BY P.id -- maxscale route to server slave1 '),
(76,NULL,NULL,NULL,NULL,NULL,NULL,'Non-interaction_Activity','P',1,'SELECT SQL_CALC_FOUND_ROWS C.person_id_student , C.person_id_faculty AS faculty, C.person_id_student AS student, P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM activity_log AS AL LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN person AS P ON C.person_id_student = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN activity_category AS AC ON C.activity_category_id = AC.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN contact_types AS CONT ON C.contact_types_id = CONT.id LEFT JOIN risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = C.person_id_student LEFT JOIN org_course_student AS OCS ON OCS.person_id = C.person_id_student LEFT JOIN org_courses AS OC ON (OCS.org_courses_id = OC.id) LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) WHERE (CONT.parent_contact_types_id = 2 OR CONT.id = 2) AND C.deleted_at IS NULL AND  C.person_id_student IN ($$personIds$$) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.contacts_id = ALOG.contacts_id WHERE related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$facultyId$$) ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$facultyId$$ ELSE C.access_public = 1 END END GROUP BY C.id -- maxscale route to server slave1 '),
(77,NULL,NULL,NULL,NULL,NULL,NULL,'Have_Not_Been_Reviewed','P',1,'SELECT SQL_CALC_FOUND_ROWS P.id , P.id AS student,  P.firstname, P.lastname, P.risk_level, RL.risk_text, RL.image_name, IL.text AS intent_to_leave_text, IL.image_name AS intent_to_leave_image, RML.risk_model_id, P.last_activity, OPS.surveycohort AS student_cohort, (count(distinct (acl.id))) as cnt, OPS.status, OPS.photo_url,pem.metadata_value as class_level FROM person P LEFT JOIN  risk_level AS RL ON P.risk_level = RL.id LEFT JOIN risk_model_levels AS RML ON RML.risk_level = RL.id LEFT JOIN intent_to_leave AS IL ON P.intent_to_leave = IL.id LEFT JOIN org_person_student AS OPS ON OPS.person_id = P.id LEFT JOIN activity_log acl on (acl.person_id_student = P.id) LEFT JOIN student_db_view_log SDV ON (SDV.person_id_student = P.id) LEFT JOIN person_ebi_metadata as pem on (pem.person_id = P.id and pem.ebi_metadata_id IN ( Select id from ebi_metadata where meta_key =\"ClassLevel\")) where   P.id IN ($$personIds$$ ) AND SDV.organization_id = $$orgId$$ AND SDV.person_id_faculty = $$facultyIds$$ AND SDV.last_viewed_on < P.risk_update_date group by P.id'),
(78,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_All_Interaction','E',1,'SELECT A.id AS AppointmentId, N.id AS NoteId, R.id AS ReferralId, C.id AS ContactId, AL.id AS activity_log_id, AL.created_at AS activity_date, AL.activity_type AS activity_type, AL.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, C.contact_types_id AS activity_contact_type_id, CTL.description AS activity_contact_type_text, R.status AS activity_referral_status, C.note AS contactDescription, R.note AS referralDescription, A.description AS appointmentDescription, N.note AS noteDescription, AL.created_at as created_date, A.start_date_time as app_created_date, C.contact_date as contact_created_date, AL.activity_date as act_date FROM activity_log AS AL LEFT JOIN Appointments AS A ON AL.appointments_id = A.id LEFT JOIN note AS N ON AL.note_id = N.id LEFT JOIN note_teams AS NT ON N.id = NT.note_id LEFT JOIN contacts AS C ON AL.contacts_id = C.id LEFT JOIN contacts_teams AS CT ON C.id = CT.contacts_id LEFT JOIN referrals AS R ON AL.referrals_id = R.id LEFT JOIN referrals_teams AS RT ON R.id = RT.referrals_id LEFT JOIN activity_category AS AC ON A.activity_category_id = AC.id OR N.activity_category_id = AC.id OR R.activity_category_id = AC.id OR C.activity_category_id = AC.id LEFT JOIN person AS P ON AL.person_id_faculty = P.id LEFT JOIN contact_types_lang AS CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN contact_types AS CONT ON C.contact_types_id = CONT.id LEFT JOIN organization_role as orgr ON orgr.organization_id = AL.organization_id LEFT JOIN referral_routing_rules as rr ON rr.activity_category_id = R.activity_category_id WHERE AL.person_id_student = $$studentId$$ AND AL.organization_id = $$orgId$$ AND AL.activity_type IN ($$acivityArr$$) AND AL.deleted_at IS NULL AND A.deleted_at IS NULL AND N.deleted_at IS NULL AND C.deleted_at IS NULL AND R.deleted_at IS NULL AND CASE WHEN AL.activity_type = \"C\" THEN CONT.parent_contact_types_id = 1 OR CONT.id = 1 ELSE 1 = 1 END AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.appointment_id = ALOG.appointments_id WHERE related.appointment_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.referral_id = ALOG.referrals_id WHERE related.referral_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.note_id = ALOG.note_id WHERE related.note_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN (SELECT ALOG.id FROM related_activities AS related LEFT JOIN activity_log AS ALOG ON related.contacts_id = ALOG.contacts_id WHERE related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND CASE WHEN AL.activity_type = \"N\" THEN CASE WHEN N.access_team = 1 THEN NT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM note_teams WHERE note_id = N.id AND deleted_at IS NULL)) AND $$noteTeamAccess$$ = 1 ELSE CASE WHEN N.access_private = 1 THEN N.person_id_faculty = $$faculty$$ ELSE N.access_public = 1 AND $$notePublicAccess$$ = 1 END END ELSE CASE WHEN AL.activity_type = \"C\" THEN CASE WHEN C.access_team = 1 THEN CT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM contacts_teams WHERE contacts_id = C.id AND deleted_at IS NULL)) AND $$contactTeamAccess$$ = 1 ELSE CASE WHEN C.access_private = 1 THEN C.person_id_faculty = $$faculty$$ ELSE C.access_public = 1 AND $$contactPublicAccess$$ = 1 END END ELSE CASE WHEN AL.activity_type = \"R\" THEN CASE WHEN R.access_team = 1 THEN RT.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$faculty$$ AND teams_id IN (SELECT teams_id FROM referrals_teams WHERE referrals_id = R.id AND deleted_at IS NULL)) AND (($$referralTeamAccess$$ = 1 and R.is_reason_routed = 0) OR ($$referralTeamAccessReasonRouted$$ = 1 and R.is_reason_routed = 1)) ELSE CASE WHEN R.access_private = 1 THEN R.person_id_faculty = $$faculty$$ ELSE R.access_public = 1 AND (($$referralPublicAccess$$ = 1 and R.is_reason_routed = 0) OR ($$referralPublicAccessReasonRouted$$ = 1 and R.is_reason_routed = 1)) END END OR R.person_id_assigned_to = $$faculty$$ OR R.person_id_faculty = $$faculty$$ OR orgr.person_id = $$faculty$$ and R.person_id_assigned_to is null AND orgr.role_id IN ($$roleIds$$) AND (rr.is_primary_coordinator = 1 AND rr.person_id IS NULL) ELSE CASE WHEN AL.activity_type = \"A\" THEN 1 = 1 ELSE 1 = 1 END END END END GROUP BY AL.id ORDER BY act_date DESC'),
(79,NULL,NULL,NULL,NULL,NULL,NULL,'Coordinator_Activity_All_Interaction','E',1,'SELECT A.id as AppointmentId, N.id as NoteId,R.id as ReferralId,C.id as ContactId,AL.id as activity_log_id,AL.created_at as activity_date,AL.activity_type as activity_type,AL.person_id_faculty as activity_created_by_id,P.firstname as activity_created_by_first_name,P.lastname as activity_created_by_last_name,AC.id as activity_reason_id,AC.short_name as activity_reason_text,C.contact_types_id as activity_contact_type_id,CTL.description as activity_contact_type_text,R.status as activity_referral_status,C.note as contactDescription,R.note as referralDescription,A.description as appointmentDescription,N.note as noteDescription FROM activity_log as AL LEFT JOIN Appointments as A ON AL.appointments_id = A.id LEFT JOIN note as N ON AL.note_id = N.id LEFT JOIN note_teams as NT ON N.id = NT.note_id LEFT JOIN contacts as C ON AL.contacts_id = C.id LEFT JOIN contacts_teams as CT ON C.id = CT.contacts_id LEFT JOIN referrals as R ON AL.referrals_id = R.id LEFT JOIN referrals_teams as RT ON R.id = RT.referrals_id LEFT JOIN activity_category as AC ON A.activity_category_id = AC.id OR N.activity_category_id = AC.id OR R.activity_category_id = AC.id OR C.activity_category_id = AC.id LEFT JOIN person as P ON AL.person_id_faculty = P.id LEFT JOIN contact_types_lang as CTL ON C.contact_types_id = CTL.contact_types_id LEFT JOIN contact_types as CONT ON C.contact_types_id = CONT.id WHERE AL.person_id_student = $$studentId$$ AND AL.organization_id = $$orgId$$ AND AL.activity_type IN ($$acivityArr$$) AND AL.deleted_at IS NULL AND A.deleted_at IS NULL AND N.deleted_at IS NULL AND C.deleted_at IS NULL AND R.deleted_at IS NULL AND CASE WHEN AL.activity_type = \"C\" THEN CONT.parent_contact_types_id = 1 OR CONT.id =1 ELSE 1=1 END AND AL.id NOT IN( SELECT ALOG.id FROM related_activities as related LEFT JOIN activity_log as ALOG ON related.note_id = ALOG.note_id where related.note_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) AND AL.id NOT IN( SELECT ALOG.id FROM related_activities as related LEFT JOIN activity_log as ALOG ON related.contacts_id = ALOG.contacts_id where related.contacts_id IS NOT NULL AND related.deleted_at IS NULL AND ALOG.deleted_at IS NULL) GROUP BY AL.id ORDER BY AL.created_at desc -- maxscale route to server slave1 '),
(80,NULL,NULL,NULL,NULL,NULL,NULL,'Activity_Email','E',1,'\nSELECT E.id AS activity_id, AL.id AS activity_log_id, E.created_at AS activity_date, E.person_id_faculty AS activity_created_by_id, P.firstname AS activity_created_by_first_name, P.lastname AS activity_created_by_last_name, AC.id AS activity_reason_id, AC.short_name AS activity_reason_text, E.email_subject AS activity_description, E.email_subject AS activity_email_subject, E.email_body AS activity_email_body FROM activity_log AS AL LEFT JOIN email AS E ON AL.email_id = E.id LEFT JOIN person AS P ON E.person_id_faculty = P.id LEFT JOIN activity_category AS AC ON E.activity_category_id = AC.id LEFT JOIN email_teams AS ET ON E.id = ET.email_id LEFT JOIN related_activities as RA ON E.id = RA.email_id LEFT JOIN activity_log AL1 ON RA.activity_log_id = AL1.id LEFT JOIN referrals AS R1 ON AL1.referrals_id = R1.id LEFT JOIN note AS N1 ON AL1.note_id = N1.id LEFT JOIN contacts AS C1 ON AL1.contacts_id = C1.id LEFT JOIN Appointments AS A1 ON AL1.appointments_id = A1.id LEFT JOIN email AS E1 ON AL1.appointments_id = E1.id WHERE E.person_id_student = $$studentId$$ AND E.deleted_at IS NULL AND (CASE WHEN AL1.activity_type IS NOT NULL AND ((AL1.activity_type = \"R\" AND R1.access_private = 1) OR (AL1.activity_type = \"C\" AND C1.access_private = 1) OR (AL1.activity_type = \"N\" AND N1.access_private = 1) OR (AL1.activity_type = \"E\" AND E1.access_private = 1)) THEN E.person_id_faculty = $$facultyId$$ ELSE CASE WHEN E.access_team = 1 THEN ET.teams_id IN (SELECT teams_id FROM team_members WHERE person_id = $$facultyId$$ AND teams_id IN (SELECT teams_id from email_teams WHERE email_id = E.id AND deleted_at IS NULL)) AND $$teamAccess$$ = 1 ELSE CASE WHEN E.access_private = 1 THEN E.person_id_faculty = $$facultyId$$ ELSE E.access_public = 1 AND $$publicAccess$$ = 1 END END END OR E.person_id_faculty = $$facultyId$$) GROUP BY E.id order by E.created_at desc\n -- maxscale route to server slave1 ');
