(1,NULL,NULL,NULL,542,99440,'2015-07-15 18:36:47','2015-07-15 18:36:47',NULL,'Gryffindor','\n                              from person p \n                              left join contacts c on (p.id = c.person_id_student)\n                              left join risk_level rl on (p.risk_level = rl.id)\n                              left join risk_model_levels rml on (rml.risk_level = rl.id)\n                              left join intent_to_leave il on (p.intent_to_leave = il.id)\n                              left join contact_types ct on (c.contact_types_id = ct.id)\n                              left join referrals r on (p.id = r.person_id_student)\n                              left join org_person_student ops on (p.id = ops.person_id)\n                              left outer join activity_log lc on (lc.person_id_student = p.id)\n                              where p.id in\n                                (select distinct person_id from org_group_students ogs where ogs.org_group_id in\n                                (select org_group_id from org_group_faculty where person_id = 99440 and deleted_at is null and org_permissionset_id in\n                               (select id from org_permissionset where accesslevel_ind_agg = 1 and deleted_at is null))\n                                and ogs.deleted_at is null  and ogs.org_group_id = \'1266\') and p.deleted_at is null\n                                and r.deleted_at is null and c.deleted_at is null  and gf.person_id=99440 group by (p.id)','{\"risk_indicator_ids\":\"\",\"intent_to_leave_ids\":\"\",\"group_ids\":\"1266\",\"referral_status\":\"\",\"contact_types\":\"\",\"courses\":{\"department_id\":\"\",\"subject_id\":\"\",\"course_ids\":\"\",\"section_ids\":\"\"},\"isps\":[],\"datablocks\":[]}',NULL,1,1),
